"""
`macbeth(colorchart::Symbol,color::Symbol)`

returns `RSpec` of one of the 24 MacBeth color patches of a given name.

available color charts:

`:Macbeth_chart1`, λ=380:10:730 nm, average of multiple measured charts from BabelColor

`:Macbeth_chart2`, λ=380:4:780 nm

`:Macbeth_chart3`, λ=380:5:780 nm

available color names:

:darkskin, :lightskin, :bluesky, :foliage, :blueflower, :bluishgreen,

:orange, :purplishblue, :moderatered, :purple, :yellowgreen, :orangeyellow,

:blue, :green, :red, :yellow, :magenta, :cyan,

:white95, :neutral8, :neutral65, :neutral5, :neutral35, :black2
"""
function macbeth(colorchart::Symbol,color::Symbol,mode = :raw)
    chart = eval(colorchart)
    color == :darkskin ? reflectance_spec(chart[:,1],chart[:,2]) :
    color == :lightskin ? reflectance_spec(chart[:,1],chart[:,3]) :
    color == :bluesky ? reflectance_spec(chart[:,1],chart[:,4]) :
    color == :foliage ? reflectance_spec(chart[:,1],chart[:,5]) :
    color == :blueflower ? reflectance_spec(chart[:,1],chart[:,6]) :
    color == :bluishgreen ? reflectance_spec(chart[:,1],chart[:,7]) :
    color == :orange ? reflectance_spec(chart[:,1],chart[:,8]) :
    color == :purplishblue ? reflectance_spec(chart[:,1],chart[:,9]) :
    color == :moderatered ? reflectance_spec(chart[:,1],chart[:,10]) :
    color == :purple ? reflectance_spec(chart[:,1],chart[:,11]) :
    color == :yellowgreen ? reflectance_spec(chart[:,1],chart[:,12]) :
    color == :orangeyellow ? reflectance_spec(chart[:,1],chart[:,13]) :
    color == :blue ? reflectance_spec(chart[:,1],chart[:,14]) :
    color == :green ? reflectance_spec(chart[:,1],chart[:,15]) :
    color == :red ? reflectance_spec(chart[:,1],chart[:,16]) :
    color == :yellow ? reflectance_spec(chart[:,1],chart[:,17]) :
    color == :magenta ? reflectance_spec(chart[:,1],chart[:,18]) :
    color == :cyan ? reflectance_spec(chart[:,1],chart[:,19]) :
    color == :white95 ? reflectance_spec(chart[:,1],chart[:,20]) :
    color == :neutral8 ? reflectance_spec(chart[:,1],chart[:,21]) :
    color == :neutral65 ? reflectance_spec(chart[:,1],chart[:,22]) :
    color == :neutral5 ? reflectance_spec(chart[:,1],chart[:,23]) :
    color == :neutral35 ? reflectance_spec(chart[:,1],chart[:,24]) :
    color == :black2 ? reflectance_spec(chart[:,1],chart[:,25]) : error("Color does not exist.")
    if mode == :raw
        return color
    elseif mode == :interp
        s = spline3(color[1],color[2],:natural)
        e = extrap(s,SPECENV.λmin:SPECENV.λmax,:quadratic)
        return interp(e,SPECENV.λmin:SPECENV.Δλ:SPECENV.λmax)
    end
end

"""
`macbeth(colorchart::Symbol,num::Int)`

returns `RSpec` of one of the 24 MacBeth color patches of a given number.

available color charts:

`:Macbeth_chart1`, λ=380:10:730 nm, average of multiple measured charts from BabelColor

`:Macbeth_chart2`, λ=380:4:780 nm

`:Macbeth_chart3`, λ=380:5:780 nm

available color patch numbers: 1 to 24
"""
function macbeth(colorchart::Symbol,num::Int)
    colorchart in (:Macbeth_chart1, :Macbeth_chart2, :Macbeth_chart3) ? nothing : DomainError("$colorchart does not exist.")
    if num < 1 || num > 24
        DomainError("Color index $num does not exist. Index must be in the range 1 to 24")
    else
        i=[:darkskin, :lightskin, :bluesky, :foliage, :blueflower, :bluishgreen, :orange, :purplishblue, :moderatered, :purple, :yellowgreen, :orangeyellow, :blue, :green, :red, :yellow, :magenta, :cyan, :white95, :neutral8, :neutral65, :neutral5, :neutral35, :black2]
        macbeth(colorchart,i[num])
    end
end

"""
`mbspec(colorchart::Symbol,name::Symbol)`

returns `RSpec` adapted to SPECENV limits for λ.
"""
function mbspec(colorchart::Symbol,name::Symbol)
    macbethspec=macbeth(colorchart,name)
    specspline=spline3(macbethspec.λ,macbethspec.r,:natural)
    extrapspline=extrap(specspline,SPECENV.λmin:SPECENV.λmax,:linear)
    lam,s=interp(extrapspline,SPECENV.λmin:SPECENV.Δλ:SPECENV.λmax)
    reflectance_spec(lam,s)
end

"""
`mbspec(colorchart::Symbol, num::Int)`

returns `RSpec` adapted to th 390:830 nm range of the standard CMF
"""
function mbspec(colorchart::Symbol, num::Int)
    macbethspec=macbeth(colorchart,num)
    specspline=spline3(macbethspec.λ,macbethspec.r,:natural)
    extrapspline=extrap(specspline,SPECENV.λmin:SPECENV.Δλ:SPECENV.λmax,:linear)
    lam,s=interp(extrapspline,SPECENV.λmin:SPECENV.Δλ:SPECENV.λmax)
    reflectance_spec(lam,s)
end

"""
`mbcolor(spec::RSpec,illum::LSpec)`

returns XYZ color according to illuminant
"""
function mbcolor(spec::RSpec,illum::LSpec)
    illum*spec*cmf(CMF2012_10)
end

